description:
 Le Dentifrice Sanogyl Rose est un dentifrice spécialement dédié aux personnes présentant des problèmes gingivaux tels que rougeurs, gonflements et saignements. Afin de leur apporter le meilleur soin au quotidien tout en respectant les gencives particulièrement sensibles, le Dentifrice Sanogyl Rose aide à :
- assurer un brossage en douceur : son complexe nettoyant doux combat la plaque dentaire de façon efficace, tout en minimisant les risques de sur-irritation des gencives;
- apaiser les gencives : grâce à l'allantoine et à l'hamamélis aux vertus anti-inflammatoires et grâce aux vitamines E et B5 connues pour leurs propriétés apaisantes;
- protéger les dents : son actif fluoré va renforcer l'émail des dents contre les attaques acides de la plaque dentaire.

Le Dentifrice Sanogyl Bi-Protect est un dentifrice spécialement dédié aux personnes souhaitant avoir une action complète lors du brossage, en prenant soin à la fois de leurs dents et de leurs gencives. Afin de leur apporter le meilleur soin au quotidien et de diminuer le risque de gingivites, la formule du dentifrice Sanogyl Bi-Protect aide à :
- reminéraliser l'émail : le calcium et le fluor vont renforcer l'émail des dents contre les attaques acides de la plaque dentaire;
- tonifier les gencives : grâce à l'action du citrate de zinc et de la chlorhexidine qui combattent et éliminent la plaque dentaire située à la base des gencives et grâce aux vitamines E et B5 connues pour leurs propriétés tonifiantes.
